import {BrowserRouter, Routes, Route} from "react-router-dom";
import './App.css';
import React from "react";
import Home from './pages/Home/Home'

function App() {
    return (
        <div className="app">
            <BrowserRouter>
                <Routes>
                    <Route path='/' element={<App/>}/>
                </Routes>
            </BrowserRouter>
        </div>
    );
}

export default App;
